/* *
 * xmlCharInRange:
 * @val: character to be validated
 * @rptr: pointer to range to be used to validate
 *
 * Does a binary search of the range table to determine if char
 * is valid
 *
 * Returns: true if character valid, false otherwise
 */
#[no_mangle]
pub unsafe extern "C" fn xmlCharInRange(mut val: std::os::raw::c_uint,
                                        mut rptr: *const xmlChRangeGroup)
 -> std::os::raw::c_int {
    let mut low: std::os::raw::c_int = 0;
    let mut high: std::os::raw::c_int = 0;
    let mut mid: std::os::raw::c_int = 0;
    let mut sptr: *const xmlChSRange = 0 as *const xmlChSRange;
    let mut lptr: *const xmlChLRange = 0 as *const xmlChLRange;
    if rptr.is_null() { return 0 as std::os::raw::c_int }
    if val < 0x10000 as std::os::raw::c_int as std::os::raw::c_uint {
        /* is val in 'short' or 'long'  array? */
        if (*rptr).nbShortRange == 0 as std::os::raw::c_int {
            return 0 as std::os::raw::c_int
        }
        low = 0 as std::os::raw::c_int;
        high = (*rptr).nbShortRange - 1 as std::os::raw::c_int;
        sptr = (*rptr).shortRange;
        while low <= high {
            mid = (low + high) / 2 as std::os::raw::c_int;
            if (val as std::os::raw::c_ushort as std::os::raw::c_int) <
                   (*sptr.offset(mid as isize)).low as std::os::raw::c_int {
                high = mid - 1 as std::os::raw::c_int
            } else if val as std::os::raw::c_ushort as std::os::raw::c_int >
                          (*sptr.offset(mid as isize)).high as std::os::raw::c_int {
                low = mid + 1 as std::os::raw::c_int
            } else { return 1 as std::os::raw::c_int }
        }
    } else {
        if (*rptr).nbLongRange == 0 as std::os::raw::c_int { return 0 as std::os::raw::c_int }
        low = 0 as std::os::raw::c_int;
        high = (*rptr).nbLongRange - 1 as std::os::raw::c_int;
        lptr = (*rptr).longRange;
        while low <= high {
            mid = (low + high) / 2 as std::os::raw::c_int;
            if val < (*lptr.offset(mid as isize)).low {
                high = mid - 1 as std::os::raw::c_int
            } else if val > (*lptr.offset(mid as isize)).high {
                low = mid + 1 as std::os::raw::c_int
            } else { return 1 as std::os::raw::c_int }
        }
    }
    return 0 as std::os::raw::c_int;
}
